import "../styles/Home.css";
import "../styles/Menu.css";


function Home() {
  return (
    <div className="home" style={{ backgroundImage: `url(${BannerImage})` }}>
      <div className="headerContainer">
        <script  src="./script.js"></script>
        <h1>Recupera Tu  <span class="txt-type" data-wait="3000" data-words='["Developer", "Designer", "Creator"]'></span></h1>
        <p> No pierdas el tiempo con tus Multas, Analizamos sin costo la posibilidad de defender tus Multas</p>
        <Link to="/Contact">
          <button> Registra tu Multa </button>
        </Link>

      </div>
       <MySwiper/>
      </div>
  





)

}



export default Home;
